import React from "react";
import { Field, ErrorMessage } from "formik";

const Video = (props) => {
  return (
    <>
      <label htmlFor={props.name}>{props.label}</label>
      <Field
        id={props.name}
        name={props.name}
        {...rest}
        onChange={(e) => console.log()}
      />
    </>
  );
};

export default Video;
